WordPress, Ghost, and flat files;

Photoshop, Illustrator, GIMP, Inkscape, and Blender;

LibreOffice, Google Docs, and Trello;

GitHub, Bitbucket, and DigitalOcean.

Once in a while will jump in AWS, but not so much resently. Would really like to
use containers more. There are so many good hosting and the like companies out
there, and so many of them are good- it can be difficult to choose one, but
mostly out of the warm techno fuzzies.

Used to use the like of 3d Studio Max, Maya, Modo, ZBrush, After Effects, and
absolutely loved Houdini; along with Quake, Unreal, and lots of other engines.
